import './jogos.css'
import { Celula } from '../../models/bingo/celula';
import Select from 'react-select';

function Jogos() {

  function countLines() {
    let texto = document.getElementById("inputBingo").value;
    var lines = texto.split("\n");
    var count = lines.length;
    console.log(count);

    const bingo = document.getElementById('bingo')
    if (count = 9) {
      document.getElementById('bingo').className = "x3"
      let celula = document.createElement("Celula");
      let i = 0;
      while (i > 10) {
        document.getElementById('bingo').appendChild(celula);
        i += 1;
      }
    };


    return (
      <div className="jogos">
        <div id='bingo'>
        </div>
        <div className='lista'>
          <h1>Jogos de Medo</h1>
          <textarea id='inputBingo' onChange={countLines} />
        </div>
      </div>
    );
  }
}

export default Jogos;
